Dưới đây là mã Python để giải quyết bài toán này bằng phương pháp đệ quy:

```python
def is_permutation(s1, s2):
    def compare(s1, s2):
        if len(s1) != len(s2):
            return False
        if not s1:
            return True
        if not s2:
            return False
        if s1[0] in s2:
            s2 = s2.replace(s1[0], '', 1)
            return compare(s1[1:], s2)
        return False

    return any(compare(s1, s2) for s2 in powerset(s2))

def powerset(s):
    if not s:
        return [[]]
    result = powerset(s[1:])
    result += [subset + [s[0]] for subset in result]
    return result
```

Trong đó, hàm `compare` so sánh hai chuỗi và kiểm tra xem một chuỗi có thể được sắp xếp thành chuỗi con của chuỗi kia hay không. Hàm `powerset` tạo ra tất cả các chuỗi con của chuỗi s2. Cuối cùng, hàm `is_permutation` gọi hàm `compare` với tất cả các chuỗi con của s2 và trả về true nếu có một chuỗi con của s2 có thể được sắp xếp thành s1.

